// FloatingPics.js
import React from 'react';
import './Theme.css'; // Ensure your CSS file (with floating pics styles) is imported

function FloatingPics() {
  return React.createElement(
    'div',
    { className: 'floating-pics-container' },
    React.createElement('img', {
      src: 'pic1.jpg', // Replace with your image path
      alt: 'Floating Pic 1',
      className: 'floating-pic'
    }),
    React.createElement('img', {
      src: 'pic2.jpg',
      alt: 'Floating Pic 2',
      className: 'floating-pic'
    }),
    React.createElement('img', {
      src: 'pic3.jpg',
      alt: 'Floating Pic 3',
      className: 'floating-pic'
    }),
    React.createElement('img', {
      src: 'pic4.jpg',
      alt: 'Floating Pic 4',
      className: 'floating-pic'
    }),
    React.createElement('img', {
      src: 'pic5.jpg',
      alt: 'Floating Pic 5',
      className: 'floating-pic'
    })
  );
}

export default FloatingPics;
